insert  into `content`(`id`,`jenis`,`judul`,`katakunci`,`content`,`flag_delete`,`created_at`,`updated_at`) values 
(1,1,'Apa itu IMB ?','SISTEM INFORMASI REKOMENDASI TEKNIS RETRIBUSI IMB','<p>Perizinan yang diberikan oleh Pemerintah Daerah kepada pemohon untuk membangun baru, rehabilitasi/renovasi, dan/atau memugar dalam rangka melestarikan bangunan sesuai dengan persyaratan administratif dan persyaratan teknis yang berlaku.<br></p>',0,'2018-10-10 23:29:43','2018-09-14 19:26:56'),
(2,0,'SIMETRIS IMB','SISTEM INFORMASI REKOMENDASI TEKNIS DAN RETRIBUSI IMB','protected/storage/quickcount/slider/content/10bf08f0bbd6689475be65b4ae441bd9/aac41d76ba895ab889e4f6cf3dafd6b8.jpg',0,'2018-10-19 06:34:33','2018-10-19 07:34:33'),
(4,1,'Apa Manfaat Memiliki IMB ?','SISTEM INFORMASI REKOMENDASI TEKNIS RETRIBUSI IMB','<ol><li>Memiliki kepastian hukum terhadap bangunan yang sesuai dengan aturan yang berlaku</li><li>Untuk keperluan pengurusan ijin usaha lainnya</li><li>Untuk keperluan perkreditan Bank</li><li>Meningkatkan nilai ekonomis lahan dan bangunan</li></ol>',0,'2018-10-10 23:29:46','2018-09-14 19:28:16'),
(10,0,'SIMETRIS IMB','Mewujudkan Karangasem Cerdas, Bersih dan Bermartabat  Berlandaskan Tri Hita Karana','protected/storage/quickcount/slider/content/10bf08f0bbd6689475be65b4ae441bd9/779304ae46b32f7fac25ea49318df073.jpg',0,'2018-10-18 21:42:01','2018-10-18 22:42:01'),
(11,0,'SIMETRIS IMB','Menuju Karangasem Cerdas, Bersih dan Bermartabat Berlandaskan Tri Hita Karana','protected/storage/quickcount/slider/content/10bf08f0bbd6689475be65b4ae441bd9/42a1b7deb73ba4111e148570953712f1.jpg',1,'2018-10-10 23:30:33','2018-09-14 18:52:01'),
(12,1,'Bagaimana Bangunan Layak Memiliki IMB ?','','<ol><li>Memenuhi persyaratan lokasi</li><li>Memenuhi persyaratan Garis Sempadan Bangunan (GSB)</li><li>Memenuhi Koofesian Dasar Bangunan (KDB)</li><li>Memenuhi Koofesien Lantai Bangunan (KLB)</li><li>Memenuhi Persyaratan Arsitektur Gedung</li></ol>',0,'2018-09-14 18:28:05','2018-09-14 19:28:05'),
