form:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" text-align:=\"\" justify;\"=\"\"><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Untuk Bangunan Rumah Tinggal</strong></p><ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\"><li style=\"box-sizing: border-box;\">Foto copy KTP/Keterangan Domisili</li><li style=\"box-sizing: border-box;\">Sertifikat tanah/Status Tanah</li><li style=\"box-sizing: border-box;\">Foto Copy Surat Pajak Tanah (PBB)</li><li style=\"box-sizing: border-box;\">Site Plan</li><li style=\"box-sizing: border-box;\">Denah &amp; gambar detail bangunan</li><li style=\"box-sizing: border-box;\">Surat pernyataan Tetangga sebelah menyebelah / Penyanding</li><li style=\"box-sizing: border-box;\">Rencana Biaya</li><li style=\"box-sizing: border-box;\">Surat pengantar Camat</li></ol><p style=\"box-sizing: border-box;\"><br></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Untuk Bangunan Pondok wisata, Home Stay (5 Kamar atau Kurang),</strong></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\"> Bangunan Usaha Diving, Rafting, Agrowisata :</strong></p><ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\"><li style=\"box-sizing: border-box;\">Foto copy KTP/Keterangan Domisili</li><li style=\"box-sizing: border-box;\">Sertifikat tanah/Status Tanah</li><li style=\"box-sizing: border-box;\">Foto Copy Surat Pajak Tanah (PBB)</li><li style=\"box-sizing: border-box;\">Site Plan</li><li style=\"box-sizing: border-box;\">Denah &amp; gambar detail bangunan</li><li style=\"box-sizing: border-box;\">Surat pernyataan Tetangga sebelah menyebelah / Penyanding</li><li style=\"box-sizing: border-box;\">Rencana Biaya</li><li style=\"box-sizing: border-box;\">Surat pengantar Camat</li><li style=\"box-sizing: border-box;\">Rekomendasi Bupati Cq. Dinas Pariwisata Kabupaten Karangasem</li><li style=\"box-sizing: border-box;\">Izin Lokasi</li></ol><p style=\"box-sizing: border-box;\"><br></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Untuk Bangunan Hotel Melati, Hotel Berbintang, Cottage</strong></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\"> dan yang sejenis (lebih dari 5 kamar), Restauran, Rumah Makan :</strong></p><ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\"><li style=\"box-sizing: border-box;\">Foto copy KTP/Keterangan Domisili</li><li style=\"box-sizing: border-box;\">Sertifikat tanah/Status Tanah</li><li style=\"box-sizing: border-box;\">Foto Copy Surat Pajak Tanah (PBB)</li><li style=\"box-sizing: border-box;\">Site Plan</li><li style=\"box-sizing: border-box;\">Denah &amp; gambar detail bangunan</li><li style=\"box-sizing: border-box;\">Surat pernyataan Tetangga sebelah menyebelah / Penyanding</li><li style=\"box-sizing: border-box;\">Rencana Biaya</li><li style=\"box-sizing: border-box;\">Surat pengantar Camat</li><li style=\"box-sizing: border-box;\">Rekomendasi Bupati</li><li style=\"box-sizing: border-box;\">Izin Lokasi</li><li style=\"box-sizing: border-box;\">Izin Prinsip Gubernur Bali (kecuali yang menggunakan fasilitas penanaman modal PMA atau PMDN)</li><li style=\"box-sizing: border-box;\">Dokumen UKL – UPL (luas lahan 2 Ha)</li><li style=\"box-sizing: border-box;\">Dokumen AMDAL (Luas lahan 5 Ha/lebih dan 200 Kamar/lebih)</li></ol><p style=\"box-sizing: border-box;\"><br></p><p style=\"text-align: center; box-sizing: border-box; margin: 0px 0px 10px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Untuk Bangunan Industri, Perumahan, Fasilitas Umum, Bangunan Khusus, Perdagangan, Pendidikan, Kelembagaan :</strong></p><ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;\"><li style=\"box-sizing: border-box;\">Foto copy KTP/Keterangan Domisili</li><li style=\"box-sizing: border-box;\">Sertifikat tanah/Status Tanah</li><li style=\"box-sizing: border-box;\">Foto Copy Surat Pajak Tanah (PBB)</li><li style=\"box-sizing: border-box;\">Site Plan</li><li style=\"box-sizing: border-box;\">Denah &amp; gambar detail bangunan</li><li style=\"box-sizing: border-box;\">Surat pernyataan Tetangga sebelah menyebelah / Penyanding</li><li style=\"box-sizing: border-box;\">Rencana Biaya</li><li style=\"box-sizing: border-box;\">Surat pengantar Camat</li><li style=\"box-sizing: border-box;\">Izin Lokasi</li><li style=\"box-sizing: border-box;\">Dokumen UKL – UPL (luas lahan kurang dari 5 Ha)</li><li style=\"box-sizing: border-box;\">Dokumen AMDAL (Luas lahan 5 Ha/lebih)</li></ol></div>',0,'2018-09-14 18:41:55','2018-09-14 19:41:55');
